            <tr>
                <td>{{ station.id }}</td>
                <td>{{ station.name }}</td>
                <td>{{ station.rent1 }}</td>
                <td>{{ station.rent2 }}</td>
                <td>{{ station.rent3 }}</td>
                <td>{{ station.rent4 }}</td>
                <td>{{ station.mortgage }}</td>
                <td>
